import React from 'react'
import {
    Form,
  } from "antd";

const FormItem = Form.Item;
function componentSuggestion() {
    return (
        <FormItem>
        <div style={{width:"398px",height:"222px",background:"white"}}>
            BAS
        </div>
        </FormItem>
    )
}

export default componentSuggestion
